import { Link } from "react-router-dom";
import Logo from "../../assets/lightCubeLogo.png";

const Navigator = () => {
  return (
    <header className="fixed left-0 bottom-0">
      <Link to="/">
        <img src={Logo} alt="logo" />
      </Link>
    </header>
  );
};

export default Navigator;
